import React, { Component } from 'react';
import EN from '../../../constant/en';
import {
  GainChart,
  KsChart,
  PRCharts,
  PredictionDistributions,
  ROCCurves,
  SingleLiftCharts,
} from '../../Charts';
import VariableImpact from '../Result/VariableImpact';
const ROCCurve =
  'data:image/svg+xml;base64,';
const rocSelected =
  'data:image/svg+xml;base64,';
const predictDist =
  'data:image/svg+xml;base64,';
const predictionDistributionSelected =
  'data:image/svg+xml;base64,';
const precisionRecall =
  'data:image/svg+xml;base64,';
const precisionRecallSelected =
  'data:image/svg+xml;base64,';
const liftChart =
  'data:image/svg+xml;base64,';
const liftchartSelected =
  'data:image/svg+xml;base64,';
const gainChart =
  'data:image/png;base64,';
const gainchartSelected =
  'data:image/png;base64,';
const ksCurve =
  'data:image/png;base64,';
const ksCurveSelected =
  'data:image/png;base64,';
const varImpactNormal =
  'data:image/svg+xml;base64,';
const varImpactSelected =
  'data:image/svg+xml;base64,';
import styles from './AdvancedView.module.css';
import Thumbnail from './Thumbnail';
import PredictTable from './PredictTable';

interface Interface {
  model:any
  isHoldout:any
  yes:any
  no:any
  project:any
}

export default class DetailCurves extends Component<Interface> {
  state = {
    curve: EN.ROCCurve,
    show: true,
  };
  handleClick = val => {
    this.setState({ curve: val });
  };
  reset = () => {
    this.props.model.resetFitIndex();
    this.setState({
      show: false,
    });
    setTimeout(() => {
      this.setState({
        show: true,
      });
    }, 0);
  };

  componentWillReceiveProps(nextProps) {
    if (nextProps.isHoldout !== this.props.isHoldout) {
      this.setState(
        {
          show: false,
        },
        () => {
          this.setState({
            show: true,
          });
        },
      );
    }
  }

  render() {
    const {
      model,
      yes,
      no,
      project,
    } = this.props;
    const { isHoldout, mapHeader } = project;
    const { curve, show } = this.state;
    let curComponent;
    let hasReset = false;

    switch (curve) {
      case EN.ROCCurve:
        curComponent = show && (
          <ROCCurves
            height={300}
            width={600}
            x_name={EN.FalsePositiveDate}
            y_name={EN.TruePositiveRate}
            model={model}
            isHoldout={isHoldout}
          />
        );
        break;
      case EN.PredictionDistribution:
        curComponent = show && (
          <PredictionDistributions
            height={300}
            width={600}
            x_name={EN.ProbabilityThreshold}
            y_name={EN.ProbabilityDensity}
            model={model}
            isHoldout={isHoldout}
          />
        );
        break;
      case EN.PrecisionRecallTradeoff:
        curComponent = show && (
          <PRCharts
            height={300}
            width={500}
            x_name={EN.Recall}
            y_name={EN.Precision}
            model={model}
            project={project}
          />
        );
        break;
      case EN.LiftChart:
        curComponent = (
          <SingleLiftCharts
            height={300}
            width={600}
            x_name={EN.percentage}
            y_name={EN.lift}
            model={model}
            isHoldout={isHoldout}
          />
        );
        hasReset = false;
        break;
      case EN.GainChart:
        curComponent = (
          <GainChart
            height={300}
            width={600}
            x_name={EN.percentage}
            y_name={EN.Gain}
            model={model}
            isHoldout={isHoldout}
          />
        );
        hasReset = false;
        break;
      case EN.KSCurve:
        curComponent = (
          <KsChart
            height={300}
            width={600}
            x_name={EN.percentage}
            y_name="KS"
            model={model}
            isHoldout={isHoldout}
          />
        );
        hasReset = false;
        break;
      case EN.VariableImpact:
        curComponent = (
          <div style={{ fontSize: 50 }}>
            <VariableImpact model={model} mapHeader={mapHeader} />
          </div>
        );
        hasReset = false;
        break;
      default:
        break;
    }
    const thumbnails = [
      {
        normalIcon: ROCCurve,
        hoverIcon: ROCCurve,
        selectedIcon: rocSelected,
        text: EN.ROCCurve,
      },
      {
        normalIcon: predictDist,
        hoverIcon: predictDist,
        selectedIcon: predictionDistributionSelected,
        text: EN.PredictionDistribution,
      },
      {
        normalIcon: precisionRecall,
        hoverIcon: precisionRecall,
        selectedIcon: precisionRecallSelected,
        text: EN.PrecisionRecallTradeoff,
      },
      {
        normalIcon: liftChart,
        hoverIcon: liftChart,
        selectedIcon: liftchartSelected,
        text: EN.LiftChart,
      },
      {
        normalIcon: gainChart,
        hoverIcon: gainChart,
        selectedIcon: gainchartSelected,
        text: EN.GainChart,
      },
      {
        normalIcon: ksCurve,
        hoverIcon: ksCurve,
        selectedIcon: ksCurveSelected,
        text: EN.KSCurve,
      },
      {
        normalIcon: varImpactNormal,
        hoverIcon: varImpactNormal,
        selectedIcon: varImpactSelected,
        text: EN.VariableImpact,
      },
    ];
    return (
      <div className={styles.detailCurves}>
        <div className={styles.leftPanel} style={{ flex: 1 }}>
          <div className={styles.thumbnails}>
            {thumbnails.map((tn, i) => (
              <Thumbnail
                curSelected={curve}
                key={i}
                thumbnail={tn}
                onClick={this.handleClick}
                value={tn.text}
              />
            ))}
          </div>
          <PredictTable isHoldout={isHoldout} model={model} yes={yes} no={no} />
        </div>
        <div className={styles.rightPanel} style={{ marginLeft: 10 }}>
          {curComponent}
          {hasReset && (
            <button
              style={{ whiteSpace: 'nowrap' }}
              onClick={this.reset}
              className={styles.button + ' ' + styles.buttonr}
            >
              {EN.Reset}
            </button>
          )}
        </div>
      </div>
    );
  }
}
